import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function Header() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary" id='nav'>
      <Container>
        <Navbar.Brand href="#home">MCQ Generator</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home" className='attend'>Attend Exam</Nav.Link>
            <Nav.Link href="#home" className='attend'>Attend Exam</Nav.Link><Nav.Link href="#home" className='attend'>Attend Exam</Nav.Link>
          </Nav>
      </Container>
    </Navbar>
  );
}

export default Header;
